import classes from "./Header.module.css";
import {Link} from "react-router-dom";
import {hasRole, isAuthenticated} from "../../services/auth/auth";

function Header({user}) {
    return (
        <div className={`${classes.header}`}>
            <Link to="/" className={`${classes.logo}`}>Logo</Link>
            <div className={`${classes.links}`}>
                <Link to="/" className={`${classes.link}`}>Home</Link>
                {isAuthenticated(user) && <Link to="profile" className={`${classes.link}`}>Profile</Link>}
                <Link to="dialogs" className={`${classes.link}`}>Dialogs</Link>
                {isAuthenticated(user) && hasRole(user, ['admin']) && <Link to="users" className={`${classes.link}`}>Users</Link>}
                <Link to="about" className={`${classes.link}`}>About Us</Link>
                <Link to="contacts" className={`${classes.link}`}>Contacts</Link>
                {!isAuthenticated(user) && <Link to="login" className={`${classes.link}`}>Login</Link>}
            </div>
        </div>
    );
}

export default Header;
